INSERT INTO `pOpenTree` VALUES ('1', '/xt/pz/ptconfig.jsp', '平台配置', '多平台控制管理-【单表格】', '1', '0', 'A-0', '${jspTop}\n<html xmlns=\"http://www.w3.org/1999/xhtml\">\n<head>\n    <title>平台配置</title>\n${gridScript}\n    <script type=\"text/javascript\"> \n        var tiketMap=${ticketMap};\n        var manageUrl=$pb.manageUrl;\n        pb={\n        		manager:null,\n        		getCols:function(){\n        			return [\n	                            { display: \'主键\', name: \'id\', width: 50, type: \'int\',hide:false,value:\"0\" },\n	                            { display: \'域名\', name: \'pt_url\',align:\"left\",editor: { type: \'text\' },value:\"http://\"},           \n	                            { display: \'备注\', name: \'pt_des\', width: 200, editor: { type: \'text\'},value:\"\" },\n	                            { display: \'平台别名\', name: \'pt_alias\', type: \'text\', width: 100, editor: { type: \'text\'},value:\"\" }\n                            ];\n        		},addNewRow:function(){\n        			pb.manager.addRow($pb.grid.initRow(pb.getCols()));\n        		},deleteRow:function(){\n        			pb.manager.deleteSelectedRow();\n        		},f_initGrid:function(gridData,gridId){\n        			var gridInfo={\n        	                columns:pb.getCols() ,\n        					 toolbar: { items: [\n	        	                { text: \'增加\', click: pb.addNewRow, icon: \'add\' },\n	        	                { line: true },\n	        	                { text: \'删除\', click: pb.deleteRow, img: \'${basePath}/js/Source/lib/ligerUI/skins/icons/delete.gif\' },\n	        	                { line: true },\n	        	                { text: \'保存\', click: pb.saveAll, icon: \'modify\' }\n	        	                ]\n        	                },\n        	                enabledEdit: true,isScroll: false,pageSize:19,pageSizeOptions:[10,19,40,50],\n        	                data: gridData,\n        	                width: \'98%\' \n        	            };\n        	            $(\"#\"+gridId).ligerGrid(gridInfo);\n        	            pb.manager = $(\"#\"+gridId).ligerGetGridManager();\n        		},saveAll:function(){\n        			var doMap={\n        					\"delete\":$pb.grid.getDeleteWhere(pb.manager.getDeleted(),\"id\"),\n        					\"add_data\":pb.manager.getAdded(),\n        					\"up_data\":pb.manager.getUpdated()\n        			};\n        			$pb.DoUrl(manageUrl+\"/pturl.do?m=sqlAll\",doMap,tiketMap,function(data){\n        				if(data.code==0){       				\n        					location.reload();\n        				}\n        			});\n        		},loadUrlData:function(){\n        			var url=manageUrl+\"/pturl.do?m=get&data=list\";\n        			var param={add:\"order by id\"};\n        			$pb.DoUrl(url,param,tiketMap, function(data){\n        				var gridData = {Rows:[],Total:0};\n        				if(data.code==0){\n        					gridData.Rows=data.data;\n        					gridData.Total=gridData.Rows.length;\n        					pb.manager.loadData(gridData);\n        				}\n                    });			\n        		}\n        };\n        $(function(){\n        	pb.f_initGrid(\"\",\"maingrid\");\n        	pb.loadUrlData();\n       });\n    </script>\n</head>\n<body  style=\"padding:0px\">\n    <div id=\"maingrid\" style=\"margin-top:5px\"></div>\n</body>\n</html>', '0', '0');
INSERT INTO `pOpenTree` VALUES ('2', '/xt/user.jsp', '用户管理', '用户数据管理-【单表格】', '1', '0', 'A-0', '${jspTop}\n<html xmlns=\"http://www.w3.org/1999/xhtml\">\n<head>\n    <title>用户管理</title>\n${gridScript}\n    <script type=\"text/javascript\"> \n        var tiketMap=${ticketMap};\n        var manageUrl=$pb.manageUrl; \n        var manager;\n        var sexData = [ { sex: 1, text: \'男\' }, { sex: 2, text: \'女\'}, { sex: 0, text: \'未知\'}];\n        pb={\n        		manager:null,\n        		getCols:function(){\n        			return [\n { display: \'姓名\', name: \'nick_name\',width: 100, editor: { type: \'text\' }},\n        			        { display: \'用户编号\', name: \'user_id\', width: 100, type: \'int\' },\n        	                         \n        	                { display: \'性别\', name: \'sex\', width: 98, editor: { type: \'select\', data: sexData, valueField: \'sex\' },  render: function (item)\n        	                    {\n        	                    for(var the in sexData){\n        	                       if(sexData[the][\"sex\"]==item.sex){\n        	                         return sexData[the][\'text\'];\n        	                       }\n        	                    } \n        	                    return \'未知\';               \n        	                } },\n        	                { display: \'用户名称\', name: \'user_name\',  width: 128, editor: { type: \'text\'} },\n        	                { display: \'QQ\', name: \'qq\', width: 128, editor: { type: \'text\'} },\n        	                //{ display: \'生日\', name: \'birthday\', width: 128, type: \"date\",format:\"yyyy-mm-dd HH:mm:ss\",editor: { type: \'date\',format: \"yyyy-MM-dd\"} },\n        	                { display: \'部门\', name: \'department\',  width: 100, editor: { type: \'text\'} },\n        	                { display: \'用户等级\', name: \'user_rank\', align:\"right\"}\n                            ];\n        		},addNewRow:function(){\n        			pb.manager.addRow($pb.grid.initRow(pb.getCols()));\n        		},deleteRow:function(){\n        			pb.manager.deleteSelectedRow();\n        		},f_initGrid:function(gridData,gridId){\n        			var gridInfo={\n        	                columns:pb.getCols() ,\n        					 toolbar: { items: [\n	        	                { text: \'增加\', click: pb.addNewRow, icon: \'add\' },\n	        	                { line: true },\n	        	                { text: \'删除\', click: pb.deleteRow, img: \'${basePath}/js/Source/lib/ligerUI/skins/icons/delete.gif\' },\n	        	                { line: true },\n	        	                { text: \'保存\', click: pb.saveAll, icon: \'modify\' }\n	        	                ]\n        	                },\n        	                enabledEdit: true,isScroll: false,pageSize:18,pageSizeOptions:[10,18,40,50],\n        	                data: gridData,checkbox: true,\n        	                width: \'98%\' \n        	            };\n        	            $(\"#\"+gridId).ligerGrid(gridInfo);\n        	            pb.manager = $(\"#\"+gridId).ligerGetGridManager();\n        		},saveAll:function(){\n        			var doMap={\n        					\"delete\":$pb.grid.getDeleteWhere(pb.manager.getDeleted(),\"user_id\"),\n        					\"add_data\":pb.manager.getAdded(),\n        					\"up_data\":pb.manager.getUpdated()\n        			};\n        			$pb.DoUrl(manageUrl+\"/user/userinfo.do?m=sqlAll\",doMap,tiketMap,function(data){\n        				if(data.code==0){\n        					location.reload();\n        				}\n        			});\n        		},loadUrlData:function(){\n        			var url=manageUrl+\"/user/userinfo.do?m=get&data=list\";\n        			var param={add:\"order by user_id\"};\n        			$pb.DoUrl(url,param,tiketMap, function(data){\n        				var gridData = {Rows:[],Total:0};\n        				if(data.code==0){   \n        					gridData.Rows=$pb.getColData(data.data,pb.getCols());        					\n        					gridData.Total=gridData.Rows.length;\n        				}\n        				pb.f_initGrid(gridData,\"maingrid\");	\n                    });			\n        		}\n        };\n        $(pb.loadUrlData());\n    </script>\n</head>\n<body  style=\"padding:0px\">\n    <div id=\"maingrid\" style=\"margin-top:5px\"></div>\n</body>\n</html>', '0', '1');
INSERT INTO `pOpenTree` VALUES ('3', '/xt/pOpenTree.jsp', '首页树节点管理', '首页节点-【单树节点表格】', '0', '12', 'A-0-1-12', '${jspTop}\n<html xmlns=\"http://www.w3.org/1999/xhtml\">\n<head>\n    <title></title>\n${gridScript}\n    <script type=\"text/javascript\"> \n        var tiketMap=${ticketMap};\n        var manageUrl=$pb.manageUrl;\n        pb={\n        		manager:null,\n        		initValue:null,\n        		cols:[ \n                                {\"align\":\"left\",\"width\":200,\"name\":\"text\",id:\"id1\",\"display\":\"展开显示title\" ,frozen: true},      \n                                {\"editor\":{\"type\":\"text\"},\"align\":\"left\",\"width\":200,\"name\":\"text\",\"display\":\"title\" },   			\n        			{\"editor\":{\"type\":\"text\"},\"align\":\"left\",\"width\":150,\"name\":\"url\",\"display\":\"跳转url\"},\n        			{\"render\": function(item){return $pb.edit.checkEdit(\'pb.manager\',item,\'isexpand\',true);},\"align\":\"left\",\"width\":30,\"name\":\"isexpand\",\"display\":\"展开\"},\n	 { \"render\": function (item){return $pb.edit.checkEdit(\'pb.manager\',item,\'isNew\',true); },\n        \"align\":\"left\",\"width\":30,\"name\":\"isNew\",\"display\":\"新窗口\"},\n	 { \"render\": function (item){return $pb.edit.checkEdit(\'pb.manager\',item,\'pOpen\',true); },\n        \"align\":\"left\",\"width\":50,\"name\":\"pOpen\",\"display\":\"用户可打开\"},\n                {\"align\":\"left\",\"width\":80,\"name\":\"id\",\"display\":\"当前节点\"},\n        		{\"name\": \"parentId\", \"display\": \"父节点\", \"width\": 100, \"align\": \"left\"},\n        		{\"align\":\"left\",\"width\":200,\"name\":\"theNode\",\"display\":\"当前节点树\",\"value\":\"A-0\"},\n        		{ display: \'模板\', isSort: false, width: 120, render: function (rowdata, rowindex, value)\n                {\n                    var h = \"\";\n                        if(rowdata.url){\n                        h += \"<a href=\'javascript:pb.show(\" + rowdata.id + \")\'>查看</a> \";\n                        h += \"<a href=\'javascript:pb.bulid(\" + rowdata.id + \")\'>生成</a> \"; \n                        }\n                    return h;\n                }\n                },\n        			{\"editor\":{\"type\":\"text\"},\"align\":\"left\",\"width\":400,\"name\":\"des\",\"display\":\"备注\"}\n        			],\nrefField:{\n        			  \"parentId\":{\n        			  data:null,\n        			  gridData:null,\n        			  setGridData:function(gd){\n	                           var d=$pb.clone(gd);\n        		         d[\'Rows\'].push({\"id\":0,\"text\":\"起点\",\"parentId\":\"\",\"theNode\":\"A\"});\n        			     this.gridData=d;\n        			     this.editor.grid.data=d;\n        			  },\n        			  setData:function(d_){\n        			     var d=$pb.clone(d_);\n        		             d.push({\"id\":0,\"text\":\"起点\",\"parentId\":\"\",\"theNode\":\"A\"});\n        			     this.data=d;\n        			  },\n        			  editor:{\n                            \"type\": \"popup\", \"valueField\": \"id\", \"textField\": \"text\", \"grid\":\n                            {\n                                \"data\":null,tree: { columnId: \'id1\' },  \"columns\": [\n                               { \"name\": \"text\",\"id\":\"id1\", \"width\": 200, \"display\": \"标题\" },\n                               { \"name\": \"id\", \"width\": 200, \"display\": \"序号\" }, \n                               { \"name\": \"parentId\", \"width\": 200, \"display\": \"父节点\" }]\n                            },\n                            \"onSelected\":function (e) { \n				var grid =pb.manager;\n				var selected = e.data[0]; \n                                if(pb.checkError(grid.lastEditRow,selected)){\n					$.ligerDialog.waitting(\'您的选择有误，请重新选择！！！\');\n				        setTimeout(function () {\n				              $.ligerDialog.closeWaitting();\n				         }, 1000);\n					 this.setValue(grid.lastEditRow.parentId);\n					 return false;\n				}\n				grid.lastEditRow.theNode=selected.theNode+\"-\"+selected.id;  \n  			   },\n                            \"searchClick\": function (e){\n                                alert(\"这里可以根据搜索规则来搜索（下面的代码已经本地搜索),搜索规则:\" + liger.toJSON(e.rules));\n                                e.grid.loadData($.ligerFilter.getFilterFunction(e.rules));\n                            }\n                        },render:function (item)\n        	              {\n        	                   d=pb.refField[\"parentId\"].data;\n        	                   for(var the in d){\n        	                       if(d[the][\"id\"]==item.parentId){\n        	                         return d[the][\'text\'];\n        	                       }\n        	                    } \n        	                    return \'未知\';               \n        	              }\n                    }\n        		}, \n        		getCols:function(d_){\n        		   if(d_){\n        		      for(var r_ in pb.refField){        		      \n        		       for(var c_ in pb.cols){\n        		           if(pb.cols[c_][\'name\']==r_){\n        		              pb.cols[c_][\'render\']=pb.refField[r_][\'render\'];\n        		              pb.cols[c_][\'editor\']=pb.refField[r_][\'editor\'];\n        		              break;\n        		           }\n        		       } \n        		      }     		    \n        			}\n        			return pb.cols;\n        		},addNewRow:function(){\n        		    var row = pb.manager.getSelectedRow();\n        		    if(pb.initValue==null){\n	        			pb.initValue=$pb.grid.initRow(pb.getCols());\n        			}\n        		    if(row){\n        		        pb.initValue[\"parentId\"]=row[\"id\"];\n        		        pb.initValue[\"theNode\"]=row[\"theNode\"]+\"-\"+pb.initValue[\"parentId\"];\n        			}\n        			pb.manager.addRow(pb.initValue);\n        		},deleteRow:function(){\n        			pb.manager.deleteSelectedRow();\n        		},f_initGrid:function(gridData,gridId){\n        			var gridInfo={\n        	                columns:pb.getCols(true) ,\n        			toolbar: { items: [\n	        	                { text: \'增加\', click: pb.addNewRow, icon: \'add\' },\n	        	                { line: true },\n	        	                { text: \'删除\', click: pb.deleteRow, img: \'${basePath}/js/Source/lib/ligerUI/skins/icons/delete.gif\' },\n	        	                { line: true },\n	        	                { text: \'保存\', click: pb.saveAll, icon: \'modify\' },\n	        	                 { line: true },\n	        	                { text: \'收缩全部\', click: pb.collapseAll, icon: \'modify\' }\n	        	                ]\n        	                },\n        	               enabledEdit: true,isScroll: false,pageSize:19,rownumbers:true,pageSizeOptions:[10,20,40,50],\n        	                data: gridData,\n        	                tree: { columnId: \'id1\' },        	                \n        	                width: \'98%\',\n        	                height:\'90%\'\n        	            };\n        	            $(\"#\"+gridId).ligerGrid(gridInfo);\n        	            pb.manager = $(\"#\"+gridId).ligerGetGridManager();\n        		},saveAll:function(){        	\n				$pb.Data.gridSave(pb.manager,tiketMap,manageUrl+\"/xt/pOpenTree.do?m=sqlAll\",\"id\",\'\');\n        		},loadUrlData:function(fun){\n				$pb.Data.load({},tiketMap,manageUrl+\"/xt/pOpenTree.do?m=get&data=list\",$pb.grid.pbCol(pb.cols),function(data){\n       				if(data.code==0){\n       				    gridData=$pb.Data.toTreeGrid(data.data,\'id\',\'parentId\');\n       				    pb.gridData=gridData;\n                                    pb.refField[\'parentId\'].setGridData(gridData);\n                                    pb.refField[\'parentId\'].setData(data.data);\n       				    pb.f_initGrid(gridData,\"maingrid\");\n       				}\n                	});		\n        		},collapseAll:function(){\n        			pb.manager.collapseAll();\n        		},show:function(no){\n        		   	var url=$pb.manageUrl+\"/xt/pOpenTree.do?m=get&data=one\";\n        			var param={pbCol:\"id,jspText\",id:no};\n        			$pb.DoUrl(url,param,tiketMap, function(data){\n        				if(data.code==0){\n        					pb.theTem.temId=no;\n        				    $(\'#temT\').val(data.data.jspText);\n                                             pb.showTemButton();\n        					pb.theTem.temDiv=$.ligerDialog.open({\n		        			   width:880,\n		        			   height:600,\n				               target: $(\"#target1\")	                \n            				});\n            			}\n            		});\n        		},bulid:function(no){\n        			if(!no){\n        			  no=pb.theTem.temId; \n        			}\n        		    $pb.bulid(no,tiketMap);\n        		},theTem:{\n        		   temDiv:null,\n        		   temId:null\n        		},save:function(){\n        		   	var url=$pb.manageUrl+\"/xt/pOpenTree.do?m=update&data=one\";\n        			var param={id:this.theTem.temId,\"jspText\":$(\'#temT\').val()};\n        			$pb.DoUrl(url,param,tiketMap, function(data){\n        				if(data.code==0){\n        				  $.ligerDialog.waitting(\'保存成功！\');\n		                          setTimeout(function ()\n		                          {\n		                         $.ligerDialog.closeWaitting();\n		                          }, 1000);\n                                             pb.showTemButton();\n        				}\n                    });	\n        		},gridData:null ,imporTem:function(){\n        		    var url=$pb.manageUrl+\"/xt/pOpenTree.do?m=imp&id=\"+this.theTem.temId;\n        			var param={};\n        			$pb.DoUrl(url,param,tiketMap, function(data){\n        				if(data.code==0){\n        				    $(\'#temT\').val(data.data.jspText);\n                            pb.showTemButton();\n        				}\n                    });	\n        		},showTemButton:function(){\n       				var temText=$(\'#temT\').val();\n     				if(temText==\"\"){\n     				    $(\"#imTem\").show();\n     				}else{\n     				    $(\"#imTem\").hide();\n     				}\n        		},\n        		checkError:function(parent,nodeRow){\n		       		var bool = false;\n		       		if(parent.id==nodeRow.id){\n		       			return true;\n		       		}\n		       		if(parent.children){\n			       		for(var par in parent.children){	       			\n			       			bool = pb.checkError(parent.children[par],nodeRow);\n			       			if(bool){\n			       				return bool;\n			       			}\n			       		}\n		       		}\n		       		return false;\n     		  }\n        };\n        $(function(){\n        	pb.loadUrlData();\n       });\n    </script>\n</head>\n<body  style=\"padding:0px\">\n    <div id=\"maingrid\" style=\"margin-top:5px\"></div>\n<div id=\"target1\" style=\"display:none;\">\n    <textarea id=\"temT\" cols=\"100\" rows=\"30\" style=\"margin: 0px; width: 850px; height: 453px;\"></textarea>\n    <br />\n    <div style=\"text-align: center;\"><input type=\"button\" id=\"imTem\" onclick=\"pb.imporTem()\" value=\"模板导入\"/>&nbsp;<input type=\"button\" onclick=\"pb.save()\" value=\"保存\"/>&nbsp;<input type=\"button\" onclick=\"pb.bulid()\" value=\"生成\" /></div>\n </div>\n</body>\n</html>', '0', '0');
INSERT INTO `pOpenTree` VALUES ('11', '/xt/pTemJsp.jsp', '模板管理', '模板', '0', '1', 'A-0-1', '${jspTop}\n<html xmlns=\"http://www.w3.org/1999/xhtml\">\n<head>\n    <title></title>\n${gridScript}\n    <script type=\"text/javascript\"> \n        var tiketMap=${ticketMap};\n        var manageUrl=$pb.manageUrl;\n        pb={\n        		manager:null,\n        		initValue:null,\n        		getCols:function(){\n        			return [\n{\"align\":\"left\",\"width\":40,\"name\":\"id\",\"display\":\"序号\"},\n{\"editor\":{\"type\":\"text\"},\"align\":\"left\",\"width\":100,\"name\":\"temName\",\"display\":\"模板名称\"},\n{\"editor\":{\"type\":\"text\"},\"align\":\"left\",\"width\":50,\"name\":\"type\",\"display\":\"类型\",value:\"内容\"},\n{\"editor\":{\"type\":\"text\"},\"align\":\"left\",\"width\":200,\"name\":\"temDes\",\"display\":\"备注\"},\n{ display: \'操作\', isSort: false, width: 120, render: function (rowdata, rowindex, value)\n                {\n                    var h = \"\";\n                        h += \"<a href=\'javascript:pb.show(\" + rowdata.id + \")\'>查看</a> \";                       \n                    return h;\n                }}];\n        		},addNewRow:function(){\n        		    if(pb.initValue==null){\n	        			pb.initValue=$pb.grid.initRow(pb.getCols());\n        			}\n        			pb.manager.addRow(pb.initValue);\n        		},deleteRow:function(){\n        			pb.manager.deleteSelectedRow();\n        		},f_initGrid:function(gridData,gridId){\n        			var gridInfo={\n        	                columns:pb.getCols() ,\n        					 toolbar: { items: [\n	        	                { text: \'增加\', click: pb.addNewRow, icon: \'add\' },\n	        	                { line: true },\n	        	                { text: \'删除\', click: pb.deleteRow, img: \'${basePath}/js/Source/lib/ligerUI/skins/icons/delete.gif\' },\n	        	                { line: true },\n	        	                { text: \'保存\', click: pb.saveAll, icon: \'modify\' }\n	        	                ]\n        	                },\n        	                enabledEdit: true,isScroll: false,pageSize:19,pageSizeOptions:[10,19,40,50],\n        	                data: gridData,detailHeight:60,rowHeight:23,\n        	                width: \'98%\' \n        	            };\n        	            $(\"#\"+gridId).ligerGrid(gridInfo);\n        	            pb.manager = $(\"#\"+gridId).ligerGetGridManager();\n        		},saveAll:function(){\n        			var doMap={\n        					\"delete\":$pb.grid.getDeleteWhere(pb.manager,\"id\"),\n        					\"add_data\":pb.manager.getAdded(),\n        					\"up_data\":pb.manager.getUpdated()\n        			};var saveing= $.ligerDialog.waitting(\'正在保存，请稍等.....\');\n        			$pb.DoUrl(manageUrl+\"/xt/pTemJsp.do?m=sqlAll\",doMap,tiketMap,function(data){\n        				if(data.code==0){       				\n        					location.reload();\n        				}else{\n                                          setTimeout(function (){\n		                                saveing.close();\n		                          }, 1000);\n                                        }\n        			});\n        		},loadUrlData:function(){\n        			var url=manageUrl+\"/xt/pTemJsp.do?m=get&data=list\";\n        			var param={pbCol:\"id,temName,temDes,type\"};\n        			$pb.DoUrl(url,param,tiketMap, function(data){\n        				var gridData = {Rows:[],Total:0};\n        				if(data.code==0){\n        					gridData.Rows=data.data;\n        					gridData.Total=gridData.Rows.length;\n        					pb.f_initGrid(gridData,\"maingrid\");\n        				}\n                    });			\n        		},show:function(no){\n	        		var url=manageUrl+\"/xt/pTemJsp.do?m=get&data=one\";\n	        		var param={pbCol:\"id,temText\",id:no};\n        			$pb.DoUrl(url,param,tiketMap, function(data){\n        				if(data.code==0){\n        					pb.theTem.temId=no;\n        				    $(\'#temT\').val(data.data.temText);\n        					pb.theTem.temDiv=$.ligerDialog.open({\n		        			   width:880,\n		        			   height:600,\n				               target: $(\"#target1\")	                \n            				});\n        				}\n                    });\n        		},theTem:{\n        		   temDiv:null,\n        		   temId:null\n        		},save:function(){\n        		   	var url=$pb.manageUrl+\"/xt/pTemJsp.do?m=update&data=one\";\n        			var param={id:this.theTem.temId,\"temText\":$(\'#temT\').val()};\n        			$pb.DoUrl(url,param,tiketMap, function(data){\n        				if(data.code==0){\n        				   alert(\"保存成功！\");\n        				}\n                    });	\n        		} \n        };\n        $(function(){\n        	pb.loadUrlData();\n       });\n    </script>\n</head>\n<body  style=\"padding:0px\">\n    <div id=\"maingrid\" style=\"margin-top:5px\"></div>\n<div id=\"target1\" style=\"display:none;\">\n    <textarea id=\"temT\" cols=\"100\" rows=\"30\" style=\"margin: 0px; width: 850px; height: 453px;\"></textarea>\n    <br />\n    <div style=\"text-align: center;\"><input type=\"button\" onclick=\"pb.save()\" value=\"保存\"/></div>\n </div>\n</body>\n</html>', '0', '0');
